INSERT INTO `sp_task_level` VALUES (9, 17, 'function getSpiderData(){\r\n\r\n  var backd = [];\r\n  var alldiv = document.querySelectorAll(\'.w528 .list_link\');\r\n  alldiv.forEach(function(e,i){\r\n    backd.push((e.querySelectorAll(\'li p a\')[0]).href);\r\n  })\r\n  return backd;\r\n}', '', 1, 1);
INSERT INTO `sp_task_level` VALUES (10, 17, 'function getSpiderData(){\n        var bb = $(\".contact>p\");\n        var nn = bb.html().split(\'<br>\');\n        var back = [];\n        for(var i=0;i<nn.length;i++){\n            var bm = nn[i].replace(/<em>/g,\'\').split(\"</em>\");\n            var kk =bm[0].replace(/(^\\s+)|(\\s+$)/g,\"\");\n            var vv =bm[1].replace(/(^\\s+)|(\\s+$)/g,\"\");\n            var m = {};\n            m[kk]=vv;\n            back.push(m);\n        }\n        return back;\n    }', '', 0, 2);
